                    pointer-events: none;
                    transition: all 0.2s ease-in;
                }

                &:focus {
                    box-shadow: 0 1px 0 0 #010101;
                }

                &:focus,
                &.active {
                    +label {
                        font-size: 12px;
                        transform: translate(-10px, -12px);
                    }
                }

            }

            textarea {

